).\n    Likewise, the Qenyaqetsa included a root NURU- with several derivatives with similar meanings (PE/12:68). \n    See also Q. nurrula \"mumbling\" (from nurru- \"murmur, grumble\") in the final version of the poem The Last Ark (MC/222-23).\n    Patrick Wynne therefore noted: S. *nûr in Núrnen \"Sad Water\"\n    is apparently \"sad\" in the sense \"bewailing, lamenting, complaining, grumbling\", no doubt a reference to the general mood of \n    the hapless laborers in \"the great slave-worked fields\" beside the lake. (See Lambengolmor/856-860)',11634,0,'2011-10-11 20:10:16',1,NULL,NULL,10315,NULL,0,1,0,NULL,143661),(15322,1,30,0,'','Ety/387, X/IU','',11636,0,'2011-10-11 20:10:16',1,NULL,NULL,11635,NULL,0,14,0,NULL,143662),(15324,4,30,0,'','Ety/387, X/IU','',11637,0,'2011-10-11 20:10:16',1,NULL,NULL,11635,NULL,0,14,0,NULL,143663),(15326,4,30,0,'','Ety/360, WJ/366, WJ/369-70, LotR/II:IV, SD/129-3','According to WJ/366, the preposition \"is normally o in all positions, though od appears occasionally before vowels, especially before o-\". With a suffixed article, see also  [[uin]]',6201,0,'2011-10-11 20:10:16',1,NULL,NULL,1040,NULL,0,20,0,NULL,143664),(15327,1,30,0,'','Ety/360, WJ/366, WJ/369-70, LotR/II:IV, SD/129-3','According to WJ/366, the preposition \"is normally o in all positions, though od appears occasionally before vowels, especially before o-\". With a suffixed article, see also  [[uin]]',6201,0,'2011-10-11 20:10:16',1,NULL,NULL,1040,NULL,0,20,0,NULL,143665),(15330,1,30,0,'','Ety/360, WJ/366, WJ/369-70, LotR/II:IV, SD/129-3','According to WJ/366, the preposition \"is normally o in all positions, though od appears occasionally before vowels, especially before o-\". With a suffixed article, see also  [[uin]]',11638,0,'2011-10-11 20:10:16',1,NULL,NULL,1040,NULL,0,20,0,NULL,143666),(15333,4,30,0,'','Ety/378','The Etymologies state that h- is prefixed to the word following this preposition, when it begins with a vowel: o Hedhil \"concerning the Elves\". Som