orrect. It might be constructed by analogy with words such as  [[hathol]]  \"axe\" (from WJ/234 and the name of a Númenórean, Hatholdir, UT:444), which is also found as hathal (in Hathaldir, name of a companion of Barahir, LR/433, untranslated but conceivably cognate) and hathel (LR/389). \n  Without entering into the details, such words end with a syllabic consonant (as in English \"people\"), and several vocalizations\n  are apparently possible in Sindarin. The epenthetical vowel is generally o, but it seems that a or e are also allowed. \n  Regarding orchal, its origin is of course different, as it is a compound word where the second element clearly derives\n  from KHAL, but it may have been assimilated, later, to this class of words by analogy.\n  We may therefore consider that orchel is a perfectly valid dialectal variant',11667,0,'2011-10-11 20:10:17',1,NULL,NULL,11666,NULL,0,1,0,NULL,143695),(15392,1,30,0,'or+hall, OS *orkʰalla','Ety/363, Ety/379, WJ/305','In his article Probable errors in the Etymologies, Helge Fauskanger lists orchel as a misreading, following Christopher Tolkien\'s note admitting that the e is uncertain.\n  However, though orchal is  attested in WJ/305, it does not necessarily mean that the form orchel is incorrect. It might be constructed by analogy with words such as  [[hathol]]  \"axe\" (from WJ/234 and the name of a Númenórean, Hatholdir, UT:444), which is also found as hathal (in Hathaldir, name of a companion of Barahir, LR/433, untranslated but conceivably cognate) and hathel (LR/389). \n  Without entering into the details, such words end with a syllabic consonant (as in English \"people\"), and several vocalizations\n  are apparently possible in Sindarin. The epenthetical vowel is generally o, but it seems that a or e are also allowed. \n  Regarding orchal, its origin is of course different, as it is a compound word where the second element clearly derives\n  from KHAL, but it may have been assimilated, later, to this class of word